import {Routes, Route, BrowserRouter, Navigate} from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        {/* //NavbarHere */}
        <div className="site-pages">
          <Routes>
            <Route Path='/login' />
            <Route Path='/signup' />
          </Routes>
        </div>
      </BrowserRouter>
    </div>
  );
}

export default App;
